import React, { useState } from 'react';
import axios from 'axios'; 
import Logo from './img/xzerologo.png'; 

function App() {
  const [webhook , setWebhook] = useState(''); 
  const [msg , setMsg] = useState('');


  function onChangeA(e) {
    setWebhook(e.target.value);
  }
  function onChangeB(e) {
    setMsg(e.target.value);
  }

  function onSubmit(e) {
      e.preventDefault(); 
      const content = {
        "content":msg
      }
      fetch(webhook,{
        method:'POST',
        headers:{
          "content-type":"application/json"
        },
        "body":JSON.stringify(content)
     })
    }
  return (
    <div className="App">
        <div className="nav">
          <h1><a href="#webhooks">Webhook Sender</a></h1>
        </div>
        <div className="section">
        <div id="error1">
        <div class="alert alert-danger d-flex align-items-center" role="alert">
        <svg class="bi flex-shrink-0 me-2" width="24" height="24" role="img" aria-label="Danger:"></svg>
        <div>
        <i className="fas fa-success">&nbsp;</i>Error:&nbsp;Check URL webhook or message !
        </div>
      </div>
        </div>
        <div id="success">
        <div class="alert alert-success d-flex align-items-center" role="alert">
        <i className="fas fa-times">&nbsp;</i><svg class="bi flex-shrink-0 me-2" width="24" height="24" role="img" aria-label="Success:"></svg>
        <div>
         Success:&nbsp;Done Send webhook message!
        </div>
       </div>
        </div>
          <form onSubmit={onSubmit}>
            <label htmlFor="webhook">Webhook URL</label>
            <input id="webhook" onChange={onChangeA} />
            <label htmlFor="message">Message</label>
            <input id="message" onChange={onChangeB} />
            <button class="btn btn-primary" type="submit">Send</button>
          </form>
        </div>
    </div>
  );
}

export default App;
